import React, { Component } from 'react';
import userData from "../userData";
import image from "../Assets/profile.png";
import {Link} from "react-router-dom";


class Projects extends Component {
    constructor(props) {
        super(props);

        this.state = {
            landingData : userData.landing
        };
    }

    render() {
        return(
            <div className="App">
                <nav className="navbar navbar-expand-lg navbar-dark bg-dark fixed-top" id="sideNav">
                    <a className="navbar-brand js-scroll-trigger" href="#page-top">
                        <span className="d-block d-lg-none">Williams Arland</span>
                        <span className="d-none d-lg-block">
                        <img className="img-fluid img-profile rounded-circle mx-auto mb-2" src={image} alt="me"></img>
                    </span>
                    </a>
                    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul className="navbar-nav mr-auto mt-2 mt-lg-0">
                            <li className="nav-item">
                                <a className="nav-link js-scroll-trigger" href="#projet1">Generateur de CV</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link js-scroll-trigger" href="#projet2">Tower Defence</a>
                            </li>
                            <Link to="/">
                                <button variant="">
                                    Home
                                </button>
                            </Link>
                        </ul>
                    </div>
                </nav>
            </div>
        );
    }
}

export default Projects;
